import PropTypes from 'prop-types'

const Button = ({ text, color, onClick }) => {
    return (
        <div class="dropdown">
        <button onclick={onClick} class="dropbtn" style={{ backgroundColor: color }}> {text}  </button>
        <div id="myDropdown" class="dropdown-content">
            <a href="#">Link 1</a>
            <a href="#">Link 2</a>
            <a href="#">Link 3</a>
        </div>
        </div>
    )
}

Button.defaultProps = {
    color: 'steelblue',
  }
  
  Button.propTypes = {
    text: PropTypes.string,
    color: PropTypes.string,
    onClick: PropTypes.func,
  }
  

export default Button
